css:
HTML,body  {background-color: transparent !important;
  background-image: -o-skin("Pagebar Transparent Skin") !important; padding:10px!Important;}

div.PaaAlue {box-shadow: 3px 3px 10px #000 !important;border-radius:10px!Important;
background-color:#111!Important;width:807px!Important;}

img[src="/opkuvat/op-logo.gif"] {
 width:0;
    height:49px;
    padding-right:100px;
background:url(data:image/png;base64,) no-repeat;
}

span.Vihrea {font-size:180%!Important;}
table.TableOmatTiedot tbody tr.Taustavari td.Oikea {background:#222!Important;}
table.TableOmatTiedot tbody tr.Taustavari td.Vasen {background:#19964b!Important;}

div.TukiNosto p {color:#CCC!Important;}
p#kirjautunut strong {color:#CCC!Important;}
div.TukiNosto table.TukinostoAukiKiinni {border-radius:6px 6px 0 0 !Important;}

div.YleinenSivu, div.YleinenVirheSivu {background:#222!Important;border-color:#333!important;}
div.YleinenSivu table.IngressiKuvalla tbody tr td p {color:#FFF!important;}
div.YleinenSivu table.IngressiKuvalla tbody tr td ul.LinkkiListaus {background:#222!important;}
div.YleinenSivu h3 {color:#e05000!important;}
ul,div.TukiNosto {background:#151515!important;border-bottom-color:#333!important;border-left-color:#333!important;border-right-color:#333!important;}
div.PalveluSisaltoAlue, div.PalveluSisaltoAlueValilehdilla {background:#151515!important;border-color:#333!Important;color:#FFF!important;}
div.PalveluSisaltoAlue h2,div.PalveluSisaltoAlue p {color:#FFF!important;}
div.Napit {background:#222!Important;border-top-color:#333!Important;}
td.Vali,a.OhjeIkoni {display:none!Important;}
table.Valilehdet td.Valittu {background:#333!Important;border-radius:6px 6px 0 0 !Important;}
table.Valilehdet td.Valittu div a {color:#e05000!important;}
table.Valilehdet {border-left-color:#333!Important;}
table.Valilehdet td {background:#222!Important;border-bottom-color:#333!Important;}
input.Nappi {background:#ff6a10!important;color:#FFF!important;}


ul#tukilinkit{display:none!Important;}
div.EtusivuNostoSisalto *,ul#apulinkit,ul.linkkilista  {background:#111!important;}
.ToimintoLinkit .ToimintoLinkkiRyhma h3 {background:#333!important;color:#FFF!important;}
.TuoteRyhmaOtsikko h1 {background:#333!Important;color:#FFF!important;}

div.IsoNosto {border-bottom-color:#333!Important;border-left-color:#333!important;border-right-color:#333!Important;}
div.TukiNosto {border-radius:6px 6px 0 0!Important;}
div.TukiNosto h6 {background:#333!important;border-radius:6px 6px 0 0!Important;}
div.TukiNosto div.TukiNostoSisalto {background:#151515!Important;}

a			{color:#CCC!important;font-weight:bold!Important;}
a:hover,a span:hover	{color:#e05000!Important;}
a span			{color:#CCC!Important;font-weight:bold!Important;}
table.TukinostoAukiKiinni,div.TukiNosto#EiOtsikkoa {border-top-color:#222!Important;}
div.TukiNostoKiinni {border-color:#222!Important;}
div#kirjautuminen h2 {border-radius:6px 0 6px 0!Important;}
div#kirjautuminen {border-right:1px solid #222!important;border-bottom:1px solid #222!important;}
#kirjautuminen #kirjautunut {border-bottom-color:#333!Important;border-right-color:#333!important;border-left-color:#e05000!important;border-top:none!Important;}
ul#valikko {border-radius:6px!Important;background:#333!Important;}
form div.PalveluSisalto table.Lomake tbody tr td div,table.Tiedot div {color:#CCC!important;}
table.Tiedot thead div, table.Lomake thead div, table.Taulukko thead div,table.Tiedot thead, table.Lomake thead, table.Taulukko thead{background:#333!important;color:#CCC!important;}
td.TasausOikea div {font-size:12pt!important;font-weight:bold!Important;}
div.TableEtuSisalto P {color:#FFF!Important;}
div#Omat p {color:white!Important;}
table.Raamit {background:#333!Important;}
tr.LomakeTaustaVari {background:#222!important;}
div.NapitSkaalautuva {background:#222!Important;border-top-color:#333!important;}
#valikko li a.avattu span,#valikko li a.avattu, #valikko li strong {background:#333!Important;border-radius:6px 6px 0 0!Important;}

input[type="text"],input,input[type="password"],textarea, select {background:#111!important;border:1px solid #333!Important;color:#FFF!important;}
input[type="text"]:focus {background:#111!important;border:1px solid #e05000!Important;}

div.Mainoselementti,div.YlaMainos {display:none!Important;}
